def count_vowels(strings):
    vowels = ['', 'e', 'i', 'o', 'u']
    vowel_counts = {}
    for string in strings:
        count = 0
        for char in string:
            if char.lower() in vowels:
                count += 1
        vowel_counts[string] = count
    sorted_vowel_counts = dict(sorted(vowel_counts.items(), key=lambda x: (-x[1], x[0])))
    return sorted_vowel_counts

